Ext.data.JsonP['Troubleshooting_problems_with_Test']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Troubleshooting problems with Test</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-43298705\" class=\"content\">\n                        <h1>Troubleshooting problems with Test</h1>\n    <p>    </p>\n    <div class=\"confbox admonition admonition-warning aui-message problem shadowed information-macro\">\n            <div class=\"title\">Enterprise Subscription Required!</div>\n            <p>This AMPLIFY Appcelerator Services feature requires an Enterprise Subscription.    </p>\n    </div>\n        <p>    </p>\n    <p>This page lists common problems and errors and you may encounter using Appcelerator Test.    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_TroubleshootingproblemswithTest-TouchTestAgenterrors\">TouchTest Agent errors</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1DYW5ub3RPcGVuUGFnZShpT1Mpb3JGYWlsZWR0b2xhdW5jaGFwcChBbmRyb2lkKQ\">Cannot Open Page (iOS) or Failed to launch app (Android)</a>    </p>\n</li></ul></li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_TroubleshootingproblemswithTest-Dashboarderrors\">Dashboard errors</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Troubleshooting_problems_with_Test-section-src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1UZXN0ZGFzaGJvYXJkZG9lc25vdGxvYWQoIlNlcnZlcmhhc2VuY291bnRlcmVkZXJyb3IuUGxlYXNldHJ5YWdhaW5vcmNvbnRhY3RzdXBwb3J0Iik\">Test dashboard does not load (&quot;Server has encountered error. Please try again or contact support&quot;)</a>    </p>\n</li></ul></li></ul>    <div class=\"section section-2 \" id=\"src-43298705_TroubleshootingproblemswithTest-TouchTestAgenterrors\">\n        <h2 class=\"heading \"><span>TouchTest Agent errors</span></h2>\n    <div class=\"section section-3 \" id=\"src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1DYW5ub3RPcGVuUGFnZShpT1Mpb3JGYWlsZWR0b2xhdW5jaGFwcChBbmRyb2lkKQ\">\n        <h3 class=\"heading \"><span>Cannot Open Page (iOS) or Failed to launch app (Android)</span></h3>\n    <p>If you get one of these errors when you start a clip recording or playing back a composition, it can mean one of the following:    </p>\n<ul class=\" \"><li class=\" \">    <p>You selected the wrong target application when starting a recording.    </p>\n</li><li class=\" \">    <p>The application is not installed on the device.    </p>\n</li></ul>    <p>    <img src=\"images/download/attachments/43298705/image2014-3-19_15_53_25.png\" alt=\"images/download/attachments/43298705/image2014-3-19_15_53_25.png\" class=\"confluence-embedded-image\">\n     <img src=\"images/download/attachments/43298705/image2014-3-19_15_55_19.png\" alt=\"images/download/attachments/43298705/image2014-3-19_15_55_19.png\" class=\"confluence-embedded-image\">\n    </img></img></p>\n    <p>First, verify that the test application is installed on the test device; if not, use Studio to re-install the app. Next, make sure you are selecting the correct application in the <strong class=\" \">Choose a Device Agent and Mobile App</strong> dialog.    </p>\n    <p>    <img src=\"images/download/attachments/43298705/image2014-3-19_16_3_12.png\" alt=\"images/download/attachments/43298705/image2014-3-19_16_3_12.png\" class=\"confluence-embedded-image confluence-content-image-border\" width=\"500\" height=\"338\">\n        </img></p>\n    </div>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298705_TroubleshootingproblemswithTest-Dashboarderrors\">\n        <h2 class=\"heading \"><span>Dashboard errors</span></h2>\n    <div class=\"section section-3 \" id=\"src-43298705_safe-id-VHJvdWJsZXNob290aW5ncHJvYmxlbXN3aXRoVGVzdC1UZXN0ZGFzaGJvYXJkZG9lc25vdGxvYWQoIlNlcnZlcmhhc2VuY291bnRlcmVkZXJyb3IuUGxlYXNldHJ5YWdhaW5vcmNvbnRhY3RzdXBwb3J0Iik\">\n        <h3 class=\"heading \"><span>Test dashboard does not load (&quot;Server has encountered error. Please try again or contact support&quot;)</span></h3>\n    <p>    <span style=\"color: #000000;\">\nIf you changed your password on the Test page, your Test password is out of sync with your Appcelerator Dashboard password. To fix this issue, change the password on the Test page back to your Appcelerator Dashboard password.    </span>\n    </p>\n    <p>    <span style=\"color: #000000;\">\n <strong class=\" \">To reset your Test password to match your Appcelerator Dashboard password</strong>:    </span>\n    </p>\n<ol class=\" \"><li class=\" \">    <p>    <span style=\"color: #000000;\">\nOpen the <a class=\"external-link external-link\" href=\"http://appctest-2.appcelerator.com/concerto/\" target=\"_blank\">Soasta CloudTest</a> page and log in. (Soasta is the underlying test automation service that enables Appcelerator Test.)    </span>\n    </p>\n</li><li class=\" \">    <p>    <span style=\"color: #000000;\">\nIn the <strong class=\" \">Central</strong> tab, go to <strong class=\" \">Settings</strong> &gt; <strong class=\" \">Account</strong>.    </span>\n    </p>\n</li><li class=\" \">    <p>    <span style=\"color: #000000;\">\nIn the <strong class=\" \">Password</strong> field, click the <strong class=\" \">Change</strong> link and enter your Appcelerator Dashboard password.    </span>\n    </p>\n</li><li class=\" \">    <p>    <span style=\"color: #000000;\">\nClick <strong class=\" \">Update</strong>.    </span>\n    </p>\n</li></ol>    <p>    <span style=\"color: #000000;\">\nOnly change your password through the Appcelerator <a class=\"external-link external-link\" href=\"https://platform.appcelerator.com\" target=\"_blank\">Dashboard</a>.    </span>\n    </p>\n    </div>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=43298705\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Troubleshooting problems with Test"});